import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'angularpipes';
  firstName:string="Kishore";
  lastName:string="K"
  joinDate:any=new Date();
  salary:number=20000.6783;
  currencysymbol:string="INR";

}
Your Name :{{firstName+" "+lastName|uppercase}}<br>
Your Name :{{firstName+" "+lastName|lowercase}}<br>
Your Name :{{firstName+" "+lastName|slice:4}}<br>
Your Name :{{firstName+" "+lastName|slice:2:6}}<br>
Join Date :<b>{{joinDate|date}}</b><br>
Join Date :<b>{{joinDate|date:'fullDate'}}</b><br>
Join Date :<b>{{joinDate|date:'shortdate'}}</b><br>
Join Date :<b>{{joinDate|date:'fullTime'}}</b><br>
Join Date :<b>{{joinDate|date:'shortTime'}}</b><br>
Join Date :<b>{{joinDate|date:'mm/yyyy/dd'}}</b><br>
Join Date :<b>{{joinDate|date:'mm/yy/dd h:m:ss am'}}</b><br>
Join Date :<b>{{joinDate|date:'hh:m:ss am z'}}</b><br>

Salary <b>{{salary|currency}}</b><br>
Salary <b>{{salary|currency:'USD'}}</b><br>
Salary <b>{{salary|currency:'INR'}}</b><br>

Your salary<input type="number" [(ngModel)]="salary"/><br>
Currency list<br>
<select [(ngModel)]="currencysymbol">
  <option value="INR">Indian Rupee</option>
  <option value="USD">US $</option>
  <option value="GBP">British Pounds</option>
  <option value="EUR">Euro</option>
</select><br><br>
Your Salary in {{salary|currency:currencysymbol}}


<router-outlet></router-outlet>
